  false,\n\t\"url\": null,\n\t\"notes\": \"This data layer provides access to Brownfields
  Grant Jurisdictions as part of the CIMC web service. The data represent polygonal
  boundaries that show different types of grants. Only properties benefiting from
  EPA Brownfields grant funding and technical assistance appear in Cleanups in My
  Community. There are different types of grants and each grant covers a specific
  area of geography. Grant areas can overlap, and often do. On the map, Brownfields
  jurisdictions will be shown as colored boundaries. Grant Jurisdictions have their
  own reports and fact sheet. For more information on Brownfields grants, see Brownfields
  Grants and Funding at https://www.epa.gov/brownfields/types-brownfields-grant-funding.
  The CIMC web service was initially published in 2013, but the data are updated on
  the 18th of each month. The full schedule for data updates in CIMC is located here:
  https://iaspub.epa.gov/enviro/data_update_v2.\",\n\t\"license_title\": null,\n\t\"extras\":
